script: |
  super -f text -I q3323.spq | sort > q3323.out

inputs:
  - name: q3323.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE - ( - col2 ) NOT IN ( - col1, 57, + + col2 * - col2 * - + 41 * + col2, + 74 );
  - name: tab2

outputs:
  - name: q3323.out
    data: |
      46	51	23
      64	77	40
      75	67	58
